import React from 'react'
import './MyPokemon.css'

const MyPokemon = (props) => {
    return (
        <div class="my-pokemon-container">
            <h2>My Pokemon</h2>
            <p>Pokemon 1</p>
        </div>
    )
}

export default MyPokemon
